ein. \nDiese Ma\u00dfnahmen treffen uns sehr hart, denn wir befinden uns mitten in den Endproben zu unserer Jubil\u00e4umspremiere DIE ACHT MILLION\u00c4RE.\nWir bedauern sehr, dass die Premiere nicht wie geplant am 27. M\u00e4rz stattfinden kann. \nWir werden die Premiere und die Feierlichkeiten anl\u00e4sslich unseres 20-j\u00e4hrigen Jubil\u00e4ums zu einem sp\u00e4teren Zeitpunkt nachholen.\nBereits erworbene Eintrittskarten f\u00fcr Vorstellungen bis 19. April 2020 k\u00f6nnen gegen Gutscheine oder Tickets f\u00fcr weitere Veranstaltungen eingetauscht werden. \nAls ein Theater ohne staatliche F\u00f6rderung trifft uns die Schlie\u00dfung hart. Wir w\u00fcrden uns freuen, wenn Sie die Tickets spenden, um unsere finanziellen Verluste in Grenzen zu halten und unseren Fortbestand damit zu sichern.\n\nBei Fragen erreichen Sie unsere Mitarbeiter unter (030) 47 99 74 88 unter info@kriminaltheater.de\nBitte haben Sie Verst\u00e4ndnis, wenn es wegen des starken Andrangs aktuell zu l\u00e4ngeren Wartezeiten kommen kann.\n\nIhr Berliner-Kriminal-Theater Team\n#theater #actor #theater #musicaltheatre #art #musical #broadway #acting #teatro #actress #music #stage #actorslife #drama #musicals #performance #film #dance #actors #love #theatrelife #play #show #comedy #cinema #photography #instagood #artist #movie #bhfyp"}}]},"shortcode":"B9w16K-IEDP","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584294354,"dimensions":{"height":565,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/90058388_238596687307581_4531616219529841124_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=109\u0026_nc_ohc=-HXzIZnxONYAX8faWKU\u0026oh=319ff728d4240a0bcb8a91945c3aa61c\u0026oe=5E9E884D","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"2186660664"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c257.0.565.565a/90058388_238596687307581_4531616219529841124_n.jpg?_nc_ht=scontent-sjc  my own granola to make sure I know exactly what\u2019s in mine! I mixed some oats, pumpkin seeds, almond, cashews, craisins, maple syrup, coconut oil and used my @ninjakitchen Foodi Digital Air Fry Oven to bake it! I love this oven because it\u2019s so much more than your conventional oven! It air fries, roasts, bakes, toasts and dehydrates! It cooks fast \u0026 evenly while also being super easy to clean! I used the 13-inch sheet pan to make a big batch of granola to have for the whole week! #sponsoredbyninja #ninjafoodioven #ninjafoodifamily"}}]},"shortcode":"B9ww4hYJ5VZ","edge_media_to_comment":{"count":36},"taken_at_timestamp":1584291719,"dimensions":{"height":1080,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/90085941_653805458702546_5036349223627477246_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=102\u0026_nc_ohc=k5gVtT096DYAX_Y7Uei\u0026oh=e8b67c1f3af873f485e9239b7614b435\u0026oe=5E9B17D9","edge_liked_by":{"count":214},"edge_media_preview_like":{"count":214},"owner":{"id":"5582774125"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/s640x640/90085941_653805458702546_5036349223627477246_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=102\u0026_nc_ohc=k5gVtT096DYAX_Y7Uei\u0026oh=342bdf14e17ccd4d19486c0503efe266\u0026oe=5EA0AD6E","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s150x150/90085941_653805458702546_5036349223627477246_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=102\u0026_nc_ohc=k5gVtT096DYAX_Y7Uei\u0026oh=5eafa6767fb300e4e72a021be49ba9bd\u0026oe=5EA0B0C9","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s240x240/90085941_653805458702546_5036349223627477246_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=102\u0026_nc_ohc=k5gVtT096DYAX_Y7Uei\u0026oh=f3287b4331cdd25f9a9dfacf3409de66\u0026oe=5EA03A83","config_width":24
